// src/pages/BlogPage.js
import React from "react";

function BlogPage() {
  return (
    <div className="container mt-5">
      <h1 className="text-primary">Tech & Cybersecurity Blog</h1>
      <ul className="list-group mt-3">
        <li className="list-group-item">Top 5 Cybersecurity Threats in 2024</li>
        <li className="list-group-item">How AI is Transforming Security</li>
        <li className="list-group-item">Why Every Business Needs a Security Audit</li>
      </ul>
    </div>
  );
}

export default BlogPage;
